script: |
  super -f text -I q8075.spq | sort > q8075.out

inputs:
  - name: q8075.spq
    data: |
      SELECT + + col2 + col0 AS col1 FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT ( + 73 > + 56 + - col0 * + + col0 * 46 * - col0 );
  - name: tab2

outputs:
  - name: q8075.out
    data: |
      104
      133
      69
